        about1: `A washing machine (laundry machine, clothes washer, washer, or simply wash) is a home appliance used to wash laundry. The term is mostly applied to machines that use water as opposed to dry cleaning (which uses alternative cleaning fluids and is performed by specialist businesses) or ultrasonic cleaners. The user adds laundry detergent, which is sold in liquid or powder form, to the wash water.`,
        about00: `5 Common Washing Problems`,
        about2: `Washer won't drain:One of the most common problems is the washing machine not draining. Either the drain pump can be clogged/broken, or the washer can be malfunctioning and not engaging the drain cycle properly.`,
